  BsEnvelope,
} from "react-icons/bs";
import { AiFillTwitterCircle } from "react-icons/ai";

import { FaFacebookF, FaLinkedinIn } from "react-icons/fa";

const HeaderAddressBar = () => {
  const faceBookHandler = () => {
    //https://twitter.com/bpradhanodisha?lang=en
